import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom'
export default function Header() {
    const navigate = useNavigate();
    const [isLogin, setLogin] = useState(true);
    // If there is already a user login, this hook navigates you to the home page
    useEffect(() => {
        let login = localStorage.getItem('login');
        setLogin(login)
        if (login) {
            navigate('/');
        }
    }, [navigate]);
  return (
    <header className="p-3 bg-light">
    <div className="container">
      <div className="d-flex flex-wrap align-items-center justify-content-center justify-content-lg-start">
        <ul className="nav col-12 col-lg-auto me-lg-auto mb-2 justify-content-center mb-md-0">
          <li><a href="#" className="nav-link text-dark px-2 text-secondary">Home</a></li>
          <li><a href="#" className="nav-link text-dark px-2">Features</a></li>
          <li><a href="#" className="nav-link text-dark px-2">Pricing</a></li>
          <li><a href="#" className="nav-link text-dark px-2">FAQs</a></li>
          <li><a href="#" className="nav-link text-dark px-2">About</a></li>
        </ul>

        <form className="col-12 col-lg-auto mb-3 mb-lg-0 me-lg-3">
          <input type="search" className="form-control form-control-dark" placeholder="Search..." aria-label="Search"/>
        </form>

        <div className="text-end">
            {
               isLogin ?
                <div class="dropdown text-end">
                    <a href="#" class="d-block link-dark text-decoration-none dropdown-toggle" id="dropdownUser1">
                        <img src="https://github.com/mdo.png" alt="mdo" width="32" height="32" class="rounded-circle"/>
                    </a>
                    <ul class="dropdown-menu text-small" aria-labelledby="dropdownUser1" >
                        <li><a class="dropdown-item" href="#">New project...</a></li>
                        <li><a class="dropdown-item" href="#">Settings</a></li>
                        <li><a class="dropdown-item" href="#">Profile</a></li>
                        <li><hr class="dropdown-divider"/></li>
                        <li><a class="dropdown-item" href="#">Sign out</a></li>
                    </ul>
                </div>
                :
                <Link to="/login"><button type="button" className="btn btn-outline-light me-2">Login</button></Link>
            }


         </div>
      </div>
    </div>
  </header>
  )
}
